import React from 'react';
import logo from '../logo.svg';
import "../App.css"

const words = ['sky', 'blue', 'falcon', 'wood', 'cloud'];

function Products() {

    const items = words.map((word, idx) =>
        <li key={idx}>{word}</li>
    );

    return (

        <div className="App">
            <h1>Amazing Recipes</h1>
            <div>
                <h2>Rendering a list inside component</h2>
                <ul>{items}</ul>
            </div>
        </div>

    );
}

export default Products;
